import React from 'react'

const Navigtn = ({menuData}) => {
    return (
        <>
        {menuData.map((curr)=>{
            const {category}=curr ;
        })}
             <nav className="navbar">
        <div className="btn-group">
          <button className="btn-group__item" >
            Breakfast
          </button>
        </div>
      </nav>
        </>
    )
}

export default Navigtn
